import styled from "styled-components"

const CustomButton = styled.button`
    position: relative;
    padding: 1em 1.5em;
    border: none;
    background-color: transparent;
    cursor: pointer;
    outline: none;
    font-size: 18px;
    margin: 1em 0.8em;
`
export default CustomButton
